import React, { useState, useEffect } from 'react'
import '../css/Workouts.scss'
import ListSubheader from '@material-ui/core/ListSubheader'
import List from '@material-ui/core/List'
import ListItem from '@material-ui/core/ListItem'
import ListItemText from '@material-ui/core/ListItemText'
import { useStateValue } from '../state'

const getWorkouts = (username, setWorkouts) => {
  fetch(`${window.location.origin}/getassignedworkouts?user=${username}`)
    .then((response) => {
      if (!response.ok) throw Error(response.statusText)
      console.log(response)
      response.json().then((json) => { setWorkouts(json) })
    }).catch(console.log)
}
const Workouts = () => {

 
  const [{ username },] = useStateValue()
  const [workouts, setWorkouts] = useState([])
  useEffect(() => {
    getWorkouts(username, setWorkouts)
  }, [username])
  return (
    <div>
      <h1 className="Workouts__header">
        THESE ARE YOUR WORKOUTS
      </h1>
        <div className="Patients__window__workouts">
         
          <div className="Patients__window__workouts__list">
            <List subheader={<ListSubheader>Your Workouts</ListSubheader>} >
              {workouts.map((data, i) =>
                <React.Fragment key={i} >
                  <ListItem button onClick={() => console.log("Click")}>
                    <ListItemText primary={data.name} />
                  </ListItem>
                </React.Fragment>)
              }
            </List>
          </div>
        </div>



      
    </div>
  );

}

export default Workouts;
